css:
.project-manager input {
  width: 100%;
}
.project-manager-list-group {
  color: #939395;
  text-shadow: none;
  padding: 1px 2px;
  margin-left: 10px;
  background: rgba(126, 127, 129, 0.08);
  border-radius: 1px;
}
.selected .project-manager-list-group {
  color: #424243;
}
.project-manager-devmode {
  float: right;
}
.project-manager-devmode:before {
  content: "\f065";
  color: #f42a2a;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  text-shadow: none;
  font-size: 14px;
  line-height: 1;
  display: inline-block;
}
